import { useState, useRef, useEffect } from 'react';

export default function SearchableDropdown({
  options,
  value,
  onChange,
  placeholder = "Search...",
  getOptionLabel = (option) => option.name || option,
  getOptionValue = (option) => option.id || option,
  filterOptions = (options, searchTerm) => {
    if (!searchTerm) return options;
    const term = searchTerm.toLowerCase();
    return options.filter(opt => {
      const label = getOptionLabel(opt).toLowerCase();
      return label.includes(term);
    });
  },
}) {
  const [isOpen, setIsOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [filteredOptions, setFilteredOptions] = useState(options);
  const dropdownRef = useRef(null);
  const inputRef = useRef(null);

  useEffect(() => {
    setFilteredOptions(filterOptions(options, searchTerm));
  }, [options, searchTerm]);

  useEffect(() => {
    function handleClickOutside(event) {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setIsOpen(false);
        setSearchTerm('');
      }
    }

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  const selectedOption = options.find(opt => String(getOptionValue(opt)) === String(value));

  function handleSelect(option) {
    const optionValue = getOptionValue(option);
    onChange(optionValue);
    setIsOpen(false);
    setSearchTerm('');
  }

  function handleInputChange(e) {
    setSearchTerm(e.target.value);
    setIsOpen(true);
  }

  function handleInputFocus() {
    setIsOpen(true);
    if (selectedOption) {
      setSearchTerm('');
    }
  }

  function handleClear() {
    onChange('');
    setSearchTerm('');
    setIsOpen(false);
  }

  return (
    <div ref={dropdownRef} style={{ position: 'relative', width: '100%' }}>
      <div
        style={{
          position: 'relative',
          cursor: 'pointer',
        }}
      >
        <input
          ref={inputRef}
          type="text"
          className="form-input"
          value={isOpen ? searchTerm : (selectedOption ? getOptionLabel(selectedOption) : '')}
          onChange={handleInputChange}
          onFocus={handleInputFocus}
          placeholder={selectedOption ? getOptionLabel(selectedOption) : placeholder}
          style={{ cursor: 'text', paddingRight: selectedOption ? '60px' : '40px' }}
        />
        {selectedOption && !isOpen && (
          <button
            type="button"
            onClick={(e) => {
              e.stopPropagation();
              handleClear();
            }}
            style={{
              position: 'absolute',
              right: '32px',
              top: '50%',
              transform: 'translateY(-50%)',
              background: 'none',
              border: 'none',
              cursor: 'pointer',
              color: '#999',
              fontSize: '18px',
              padding: '0 4px',
            }}
            title="Clear selection"
          >
            ×
          </button>
        )}
        <span
          style={{
            position: 'absolute',
            right: '12px',
            top: '50%',
            transform: 'translateY(-50%)',
            pointerEvents: 'none',
            color: '#666',
          }}
        >
          {isOpen ? '▲' : '▼'}
        </span>
      </div>

      {isOpen && (
        <div
          style={{
            position: 'absolute',
            top: '100%',
            left: 0,
            right: 0,
            zIndex: 1000,
            background: 'white',
            border: '2px solid #e0e0e0',
            borderTop: 'none',
            borderRadius: '0 0 8px 8px',
            maxHeight: '300px',
            overflowY: 'auto',
            boxShadow: '0 4px 12px rgba(0, 0, 0, 0.15)',
            marginTop: '-2px',
          }}
        >
          {filteredOptions.length === 0 ? (
            <div style={{ padding: '12px', color: '#999', textAlign: 'center' }}>
              No results found
            </div>
          ) : (
            filteredOptions.map((option, idx) => {
              const optionValue = getOptionValue(option);
              const optionLabel = getOptionLabel(option);
              const isSelected = optionValue == value;

              return (
                <div
                  key={idx}
                  onClick={() => handleSelect(option)}
                  style={{
                    padding: '12px',
                    cursor: 'pointer',
                    background: isSelected ? '#f0f0f0' : 'white',
                    borderBottom: '1px solid #f0f0f0',
                    transition: 'background 0.2s',
                  }}
                  onMouseEnter={(e) => {
                    if (!isSelected) e.target.style.background = '#f8f9fa';
                  }}
                  onMouseLeave={(e) => {
                    if (!isSelected) e.target.style.background = 'white';
                  }}
                >
                  {optionLabel}
                </div>
              );
            })
          )}
        </div>
      )}
    </div>
  );
}
